import React from 'react';
import logo from './logo.svg';
import poll from './Event'
import test from "./test-assignment"
import './App.css';

function App() {



  return (


    <div className="App">

    <BPP/>

    </div>




  );
}

class BPP extends React.Component{

    render(){
        return (<div className='sport_event'>bgd </div>);
    }


    componentDidMount(){
        let sportEvent=document.querySelectorAll(".sport_event");
        let value=JSON.parse(JSON.stringify(test));
        for(let val of value){
            sportEvent.item(0).innerHTML+=val.awayName;
        }

    }


}



export default App;
